import './App.css';
import Home from './routes/Home';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {
  return <Router>
            <Switch>
              <Route path="/">
                <Home />
              </Route>
            </Switch>
         </Router>
}

export default App;
